import { React } from "react";
import { ReactSVG } from 'react-svg';
import EnergySVG from '../../../svg/Energy.svg';
import EnergyFull from '../../../svg/Energy-Fill.svg';
import src from "../../../svg/Energy.svg";


const EnergyIcon = () => {
    let icons = [EnergySVG,EnergyFull];
    let i = 0, contur = 0;

    function handleClick(e){
        e.preventDefault();
        i++;
        if(i%2===0)
        {
            return EnergySVG;
        }
        else
        {
            return EnergyFull;
        }
    }

    return(
            <ReactSVG
                    afterInjection={(error, svg) => {
                      if (error) {
                        console.error(error)
                        return
                      }
                      console.log(svg)
                    }}
                    beforeInjection={(svg) => {
                      svg.classList.add('svg-class-name')
                      svg.setAttribute('style', 'width: 300')
                    }}
                    evalScripts="always"
                    fallback={() => <span>Error!</span>}
                    loading={() => <span>Loading</span>}
                    renumerateIRIElements={false}
                    src={icons[contur]}
                    onClick={src}
                    useRequestCache={false}
                    wrapper="div"/>
    );
}

export default EnergyIcon;
